list.item:
Afdeling Veterinaire Inspectie van de Volksgezondheid (1945-1970):


Keuring van vlees en vleeswaren;

toezicht op de destructieplicht voor dierlijk afvalmateriaal;

toezicht op de toepassing van antibiotica, hormonen, thyreosta-tica en chemotherapeutica;

toezicht op stralenbescherming en radio-aktiviteit;

toezicht op de verontreiniging van lucht, bodem en water door toepassing van pesticiden, industriële activiteiten e.d. voor zover het dier hierbij als indicator optreedt;

wering en bestrijding van zoönosen.

Afdeling Veeartsenijkundige Aangelegenheden (1945-1956):


Dienst van de ambtenaren behorende tot het Veeartsenijkundig Staatstoezicht;

de keuring van voor uitvoer bestemd vee en vlees;

de bewerking van de veeartsenijkundige verslagen;

het aanknopen en onderhouden van betrekkingen met buitenlandse veeartsenijkundige diensten;

de RSI;

het SVOI;

de Wet op de uitoefening der Veeartsenijkunst (vanaf 1954 Wet op de uitoefening der Diergeneeskunst);

de Pluimveewet (vanaf 1950 de Vogelziektenwet);

de Tuberculinewet;

de Tularemiewet.

Veeartsenijkundige Dienst (1957-1969):


Toezicht op de gezondheidstoestand van de veestapel;

het verzamelen van gegevens omtrent de aanwezigheid van besmettelijke veeziekten;

de vaststelling van de oorzaken en de bestrijding van besmettelijke veeziekten;

het geven van voorlichting op diergeneeskundig gebied;

de wering en bestrijding van hondsdolheid bij honden en katten;

de behandeling van aangelegenheden geregeld in de verschillende veterinaire wetten;

het keuren van vee en vlees bestemd voor de export;

de behandeling van alle andere niet genoemde diergeneeskundige aangelegenheden,  zowel nationaal als internationaal;

de RSI en het SVOI (tot 1958/1959, daarna SDO).

Veeartsenijkundige Dienst (vanaf 1970):


aangelegenheden betreffende de gezondheidstoestand van dieren, voortvloeiende uit de wettelijke regelingen tot wering en bestrijding van besmettelijke dierziekten;

veterinaire aangelegenheden in het kader van de EEG en op ander internationaal terrein;

aangelegenheden met betrekking tot voorlichting en onderzoek op diergeneeskundig gebied;

aangelegenheden inzake keuring van voor export bestemde dieren, vlees, vleeswaren en andere dierlijke produkten en het afgeven van de vereiste exportcertificaten;

zaken met betrekking tot de uitoefening van de diergeneeskunst alsmede geneesmiddelen,  sera en entstoffen.

processinfo.p:
De totale archiefperiode is te verdelen in drie 'tienjaren-blokken': 


blok 1 - 1954-1960;

blok 2 - 1961-1970;

blok 3 - 1971-1979.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
